import React from 'react'
import NewsAPI from '../../api/NewsApi'

const New = () => {
    useEffect(async() => {
        const {data} = await NewsAPI.getAllNews()
    }, [])
    return (
        <div>
            this is news
        </div>
    )
}

export default New
